import { Formik, Form, Field, ErrorMessage } from 'formik'
export default function Login() {
  if(localStorage.getItem("IdUsuario")==null){
    toast.error("No hay sesion activa")
    
  }
  const navigate = useNavigate()
  return (
    <div>Login</div>
  )
}
